// src/components/TermOfTheWeekCard.js
import React from 'react';
import './TermOfTheWeekCard.css';

const TermOfTheWeekCard = () => {
  return (
    <div className="term-card">
      <h3>Term of the Week: Syncopation</h3>
      <p><strong>Definition:</strong> A disturbance or interruption of the regular flow of rhythm...</p>
      <p><strong>Example:</strong> Syncopation is widely used in genres like jazz, funk, and hip-hop...</p>
    </div>
  );
};

export default TermOfTheWeekCard;
